import React from "react";
import "../scss/_MainView.scss";
import NewQuiz from "./NewQuiz";

function MainView() {
  return (
    <div className="appBody">
      <header className="header">
        <div className="logo" />
      </header>
      <NewQuiz />
    </div>
  );
}

export default MainView;
